  <style>
    * {
      margin: 0;
      padding: 0;
      box-sizing: border-box;
      font-size: 96.89% !important;
      line-height: 106.44% !important;
    }

    ul {
      list-style-type: none
    }

    img {
      max-width: 100%
    }

    body {
      font-family: Roboto, Helvetica Neue, -apple-system, Arial, sans-serif;
      font-size: 13px;
      background: #000;
      color: #fff;
      max-width: 600px;
      margin: 0 auto
    }

    .header {
      width: 750px;
      max-width: 100%;
      margin: 0 auto
    }

    .header__wrapper {
      height: 50px;
      display: flex;
      align-items: center;
      justify-content: space-between;
      padding: 0 5px
    }

    .header__logo {
      font-weight: 700;
      text-shadow: 0 0 1px #ff5959;
      padding: 0 10px
    }

    .header__logo span {
      color: #ff5959;
      text-shadow: none
    }

    .header__controls {
      display: flex;
      align-items: center;
      gap: 24px
    }

    .header__menu {
      background: #212125;
      height: 32px;
      display: flex;
      align-items: center;
      justify-content: center;
      gap: 10px;
      font-weight: 700;
      font-size: 14px
    }

    .header__menu-icon {
      display: flex;
      flex-direction: column;
      width: 16px;
      gap: 3px
    }

    .header__menu-icon span {
      width: 100%;
      height: 2px;
      background: #fff
    }

    .header__tags {
      padding: 14px 4px
    }

    .header__tags-wrapper {
      margin-bottom: 14px;
      display: flex;
      flex-wrap: wrap;
      justify-content: center;
      align-items: center;
      gap: 6px
    }

    .header__tags-wrapper:last-child {
      margin-bottom: 0
    }

    .header__tags-item {
      display: flex;
      align-items: center;
      justify-content: center;
      gap: 5px;
      font-weight: 700;
      border: 1px #292828 solid;
      border-radius: 4px;
      padding: 5px 7px 5px 6px
    }

    .header__tags-item.item--red {
      color: #fff;
      background: #de3151
    }

    main {
      min-height: calc(100vh - 240px);
      display: flex;
      flex-direction: column
    }

    .main__item {
      margin-bottom: 10px;
      flex: 1 1 auto;
      display: flex;
      flex-direction: column
    }

    .main__item:last-child {
      margin-bottom: 0
    }

    .main__item .item__image {
      width: 100%;
      overflow: hidden;
      position: relative;
      flex: 1 1 auto;
      min-height: 220px
    }

    .main__item .item__image .image {
      position: absolute;
      top: 50%;
      left: 50%;
      transform: translate(-50%, -50%);
      min-height: 100%;
      min-width: 100%;
      filter: blur(30px)
    }

    .main__item .item__content {
      background: #101010;
      border: 1px solid #292828;
      color: #e8e8e8;
      padding: 5px 4px
    }

    .main__item .item__title {
      text-align: center;
      margin-bottom: 18px;
      font-weight: 600
    }

    .main__item .item__info-wrapper {
      display: flex;
      align-items: center;
      justify-content: space-around;
      color: #acb6be
    }

    .main__item .item__info-wrapper [class^=item__] {
      display: flex;
      align-items: center;
      gap: 5px
    }

    .pl {
      display: flex;
      flex-grow: 1;
      margin-top: 10px;
      min-height: 212px;
      position: absolute;
      top: 0;
      left: 0;
      width: 100%;
      height: 100%;
      z-index: 2
    }

    .pl__cnt {
      background-size: contain;
      background-position: center center;
      background-repeat: no-repeat;
      flex-grow: 1
    }

    .pl__cnt {
      align-items: center;
      display: flex;
      justify-content: center;
      position: relative
    }

    .pl__ctr {
      align-items: center;
      bottom: 0;
      display: flex;
      height: 50px;
      position: absolute;
      width: 100%
    }

    .pl__ctr-tm {
      font-size: 11px;
      margin: 0 20px 0 15px
    }

    .pl__ctr-bar {
      background-color: #3f3f3f;
      flex-grow: 1;
      height: 2px;
      margin-right: 15px;
      position: relative
    }

    .pl__ctr-bar:before {
      background-color: #fff;
      border-radius: 50%;
      content: '';
      cursor: pointer;
      height: 16px;
      left: -8px;
      position: absolute;
      top: -8px;
      width: 16px;
      z-index: 1
    }

    .pl__ctr-bar-line {
      -webkit-animation: a 5s both;
      animation: a 5s both;
      background-color: #9f9f9f;
      height: 100%;
      left: 0;
      position: absolute;
      transform-origin: left;
      width: 85%
    }

    .pl__ctr-ic {
      cursor: pointer;
      fill: #fff
    }

    .pl__ctr-ic.hd {
      background-color: #000;
      border-radius: 4px;
      fill: #b6d4f0;
      height: 16px;
      width: 33px
    }

    .pl__ctr-ic.mute {
      height: 14px;
      margin: 0 15px
    }

    .pl__ctr-ic.resize {
      height: 18px;
      margin-right: 15px
    }

    .lst__t {
      font-size: large;
      font-weight: 700;
      padding: 0 10px
    }

    .lst__w-i {
      display: flex
    }

    .lst__i {
      background: #292929;
      border-radius: 4px;
      margin: 5px;
      padding: 7px;
      width: 100%;
      overflow: hidden
